import './career.css';
import { Header } from '../Header';
export const Career = () => {  
  return (
    <>
    <Header />
    <div className="career-first-section">
      <h1>Career</h1>
      <p>Join our team and help us build amazing products!</p>
    </div>
    </>
  );
}
